import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Switch,
  Route,
  Link
} from "react-router-dom";

import TemplateGenerator from './TemplateGenerator';
import logo from './logo.svg';
import './App.css';

function App() {
  return(
    <Router>
    <Routes>
      <Route path="/" element={<TemplateGenerator />} />
    </Routes>
  </Router>

  );
}

export default App;
